import React,{useEffect} from 'react';
import axios from 'axios';
import {Link} from 'react-router-dom';
import {toast} from 'react-toastify';
import { Button, Container, Row, Col, Alert, Table, Navbar, Nav, NavDropdown } from 'react-bootstrap';
import '../css/Home.css'
class Home extends React.Component{

  state={
    patientData:[]
  }
    
 

      componentDidMount(){
        axios.get('http://localhost:8080/clinicalservices/api/patients').then(res=>{
          const patientData = res.data;
          this.setState({patientData})

        })

      }


    
      

      render(){
        var variant="";
        return (
        <div>
                      <Navbar collapseOnSelect expand="lg" bg="dark" variant="dark">
              <Navbar.Brand href="/" style={{ color: '#5bc0de'}} >Neno's Clinic</Navbar.Brand>
              <Navbar.Toggle aria-controls="responsive-navbar-nav" />
              <Navbar.Collapse id="responsive-navbar-nav">
                <Nav className="mr-auto">
                 
                </Nav>
                <Nav>
                  <Nav.Link href="/addPatient" style={{ color: '#5bc0de'}}>Add Patient</Nav.Link>
                </Nav>
              </Navbar.Collapse>
            </Navbar>
        <Container fluid>
        <Row className="justify-content-md-center mt-5">  
        <Col md="auto"><h2 class="mt-5">Patient:</h2></Col>
        </Row>
        </Container>
        <Container fluid>
        <Row className="justify-content-md-center mt-5">
          <Col md="auto">
        <Table striped bordered hover size="sm" variant="dark">
          <div class ="table-responsive">
          <thead>
            <tr>
              <th>First Name</th>
              <th>Last Name</th>
              <th>Age</th>
              <th colSpan="3">Change Data</th>
            </tr>
          </thead> 
          <tbody>
            {this.state.patientData.map(patient=><RowCreator item={patient} key={patient.id} />)}
          </tbody>
          </div>
        </Table>
        </Col>
        </Row>
        </Container>
        </div>
        )
      }
    }

    class RowCreator extends React.Component {
      
      render() {

      
      function povikaj(id){

     
      
        axios.get('http://localhost:8080/clinicalservices/api/patients/delete/'+id).then(res=>{
          toast("Patient Deleted Sucessfully, pls wait 3 seconds",{autoClose:3000,position:toast.POSITION.BOTTOM_CENTER})
          
          setTimeout(function() {
            window.location.reload();
            }.bind(this), 3000);
        })
        
             
      }

       

    var patient = this.props.item;

    return (
      <tr>
        <td>{patient.firstName}</td>
        <td>{patient.lastName}</td>
        <td>{patient.age}</td>
        <td>
          <Link to={"/patientDetails/" + patient.id}><Button class="btn-block" variant="info">Add Data</Button></Link>
        </td>
        <td>
          <Link to={"/analyze/" + patient.id}><Button class="btn-block" variant="info">Analyze</Button></Link>
        </td>
        <td>
        <Button variant="info" onClick={()=>povikaj(patient.id)}>Delete</Button>
        </td>
      </tr>
    );
  }
}

export default Home;
